'''Given: A DNA string s (of length at most 100 kbp) in FASTA format.
Return: The failure array of s.'''


class KMP:
    def __init__(self,s):
         self.failure_array = self.get_failure_array_of_DNA_string(s)

    def get_failure_array_of_DNA_string(self,DNA_string):
        result = [-1]
        k,j = 0,-1
        while k < len(DNA_string):
            while (j >= 0 and DNA_string[k] != DNA_string[j]):
                j = result[j]
            j+=1
            k+=1
            result.append(j)
        return result[1:]

    def find_t_in_s(self,s,t):
        return [n + 1 for n in range(len(s)) if s.find(t, n) == n]

    def find_motif_in_string(self,inputString,motif):
        return self.find_t_in_s(inputString,motif)


def main():
    s = ''
    t = 'GTTAGGCGT'
